#Se cargan datos de tabla predios
CREATE TABLE `t15web_predios` (
  `a15Codigo` INT(11) NOT NULL AUTO_INCREMENT COMMENT 'Identificador de la tabla t15',
  `a15Vereda` INT(11) NOT NULL COMMENT 'Identificador de la vereda',
  `a15Predio` VARCHAR(200) COLLATE utf8_spanish_ci NOT NULL COMMENT 'Nombre del predio',
  `a15Estado` ENUM('A','I') COLLATE utf8_spanish_ci DEFAULT NULL COMMENT 'Valor que corresponde al estado del predio',
  PRIMARY KEY  (`a15Codigo`)
) ENGINE=INNODB AUTO_INCREMENT=741 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

